public Elements select(String query) {
return Selector.select(query, this);
}

private Selector(String query, Element root) {
Validate.notNull(query);
query = query.trim();
Validate.notEmpty(query);
Validate.notNull(root);
this.elements = new LinkedHashSet<Element>();
this.query = query;
this.root = root;
this.tq = new TokenQueue(query);
}

public static Elements select(String query, Element root) {
return new Selector(query, root).select();
}

public int hashCode() {
int result = key != null ? key.hashCode() : 0;
result = 31 * result + (value != null ? value.hashCode() : 0);
return result;
}

public Character consume() {
Character c = queue.charAt(pos);
pos++;
return c;
}

private void parseTextNode() {
if (tq.peek().equals('<')) {
String text = tq.consumeTo("<");
textNode = TextNode.createFromEncoded(text, baseUri);
last().appendChild(textNode);
}

public Character peek() {
return isEmpty() ? null : queue.charAt(pos);
}

private void parseEndTag() {
tq.consume("</");
String tagName = tq.consumeTagName();
tq.chompTo(">");
if (tagName.length() != 0) {
Tag tag = Tag.valueOf(tagName);
if (!last().tag().isIgnorableEndTag(tag)) // skips </tr> if in <table>
popStackToClose(tag);
}

boolean isIgnorableEndTag(Tag child) {
for (Tag endTag : ignoreEndTags) {
return false;
}

public static TextNode createFromEncoded(String encodedText, String baseUri) {
String text = Entities.unescape(encodedText);
return new TextNode(text, baseUri);
}

protected Node() {
childNodes = Collections.EMPTY_LIST;
attributes = null;
}

public TextNode(String text, String baseUri) {
this.baseUri = baseUri;
this.text = text;
}

public static Document parse(String html) {
return Parser.parse(html, "");
}

private Element popStackToClose(Tag tag) {
int counter = 0;
Element elToClose = null;
for (int i = stack.size() -1; i > 0; i--) {
counter++;
Element el = stack.get(i);
Tag elTag = el.tag();
if (elTag.equals(bodyTag) || elTag.equals(htmlTag)) { // once in body, don't close past body
} else if (elTag.equals(tag)) {
elToClose = el;
break;
if (elToClose != null) {
for (int i = 0; i < counter; i++) {
stack.removeLast();
return elToClose;
}

